  \"fish-reptile-and-amphibian-biodiversity-of-wetlands-ponds-and-scour-holes-on-the-floodplai\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In the summer of 2009, a survey was conducted
  of of 15 previously unsampled water bodies at four different sites within the Big
  Muddy NFWR. A brief survey of various small wetlands, ponds and scour holes was
  conducted at four units of Big Muddy NFWR to determine the presence of fish, amphibians
  and reptiles. This inquiry is for the purpose of documenting the presence and variety
  of wildlife utilizing these habitats. The survey included nine sites at Overton
  Bottom South, two sites at Jameson Island, two sites at Providence Bend, and two
  sites at Cora Island.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
